import React, {useState, useEffect} from "react";

function Feature(){
    const [featureList, setFeatureList] = useState([]);

    useEffect(function(){
        fetch("/features/").then(function(res){
            if(res.ok){
                return res.json();
            }
        }).then(function(jsonRes){
            setFeatureList(jsonRes.feature);
        })
    });

    return (<div>
        {featureList.map(function(feature){
            <li>{feature.title}</li>,
            <img src = {feature.photo} />
        })}
    </div>);
}

export default Feature;
